import React from 'react';
import { BrowserRouter, Router, Route , Routes} from 'react-router-dom';
import Homepage from './Home';

const App = () => {
  return (
    <BrowserRouter>    
    <Router>
      <Routes>
        <Route path="/home" component={Homepage} />
      </Routes>
    </Router>
    </BrowserRouter>
  );
};


export default App;
